# Generated by re2c
# re2py $INPUT -o $OUTPUT -s

def lex(str):
    cur = 0
    
    yystate = 0
    while True:
        match yystate:
            case 0:
                yych = str[cur]
                cur += 1
                if yych <= 0x30:
                    yystate = 1
                    continue
                if yych <= 0x39:
                    yystate = 2
                    continue
                yystate = 1
                continue
            case 1:
                return False
            case 2:
                yych = str[cur]
                if yych <= 0x2F:
                    yystate = 3
                    continue
                if yych <= 0x39:
                    cur += 1
                    yystate = 2
                    continue
                yystate = 3
                continue
            case 3:
                return True
            case _:
                raise "internal lexer error"


assert lex(b"1234\0")
